import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import bd from '../../bancoDeDados/bancoDeDados.json';



class Card extends Component {
   constructor(props){
       super();
     
   }
    render() {
        return (
           <div className='card'>
            <div className='card-header'></div>
                <ul className="list-group list-group-flush">
                   <label>{this.props.pais}</label>
                    <li className="list-group-item">{this.props.idh}</li>
                    <label>Expectativa de vida</label>
                    <li className="list-group-item">{this.props.exp}</li>
                </ul>
            </div>
        )
    }
}

export default Card
